    [],nt"num_tags": 5,nt"name": "fergus-falls-wetland-management-district-annual-narrative-report-calendar-year-1990",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Fergus
    Falls National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, other manpower programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, croplands, grasslands, haying, fire management, pest control,
    water rights, wilderness areas, and WPA easements. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, other migratory species, game mammals,
    other resident wildlife, fisheries resources, and animal control. The public uses
    of the Refuge described in this report include interpretive programs, hunting, fishing,
    trapping, wildlife observations, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, rehabilitation,
    major maintenance, equipment utilization and replacement, communication systems,
    computer systems, and energy conservation. Items of interest are provided at the
    end. Photographs and Refuge brochures are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
